import React from 'react'
import { Form, FormGroup } from 'reactstrap';

const AddCourse=()=>{

    return (
      <div>
        <Form>
          <FormGroup>
            <Label for="userId">Course Id</Label>
            <Input
              type="text"
              name="userId"
              id="userId"
              placeholder="Type Here"></Input>
        
          </FormGroup>
        </Form>
      </div>
    );
}

export default AddCourse;
